alpha: 	.word 1
beta:   .word 1
N:      .word 64

.text
        la  s1, a
        la  s2, b
        la  s3, c
        la  s4, d
        la  s5, T1
        la  s6, T2
        lw  s7, alpha
        lw  s8, beta
        lw  s9, N

        # Preliminary part: ... #
		li t0, 0			#t0 = n
		mul t1, s9, s9		#t1 = N * N

transposta:
		bge t0, t1, end		#if( n < N * N ) -> end

		div t2, t0, s9		#t2 = n / N

		rem t3, t0, s9		#t3 = n % N
		mul t3, t3, s9		#if( t3 = 1 ){ t3 = N }

		add t3, t3, t2		#t3 = N + n / N ou t3 = n / N 

		slli t3, t3, 2		
		add t3, t3, s2
		lw t3, 0(t3)
		#t3 = &B[N*j + i]		

		slli t2, t0, 2
		add t2, t2, s6
		sw t3, 0(t2)
		#t2 = &B[n]			

		addi t0, t0, 1
		j transposta
end:
        # First part: T1 = A*B #

        # Inicialização de auxiliares:
        addi t0, zero, 4 #
        mul a3, s9, t0   # a3 -> 4*N
        add a0, zero, s1 # a0 -> *A
        add a1, zero, s2 # a1 -> *B
        add t0, zero, a1 # t0 -> *auxB = B
        add a2, zero, s5 # a2 -> *T1

        # for(i=0,...,...){
        add t1, zero, zero
f1loop1:
        # for(j=0,...,...){
        add t2, zero, zero
f1loop2:
        # for(k=0,...,...){
        add t3, zero, zero
        # aux1 = 0
        add t4, zero, zero
f1loop3:
        # ... += memory(A,R,i,k,0)*...
        lw t5, 0(a0)
        # ... += ...*memory(B,R,k,j,0)
        lw t6, 0(a1)
        # ... += memory(A,R,i,k,0)*memory(B,R,k,j,0)
        mul t5, t5, t6 
        # aux1 += memory(A,R,i,k,0)*memory(B,R,k,j,0)
        add t4, t4, t5
        # A++
		addi a0, a0, 4
        # auxB += N*4 (salta uma linha)
        addi a1, a1, 4
        # for(...,...,k++)
        addi t3, t3, 1
        # for(...,k < size,...)
        blt t3, s9, f1loop3
        # }
        # memory(T1,W,i,j, aux1)
        sw t4, 0(a2)
        # T1++
        addi a2, a2, 4
        # A -= N*4 (rebobina para o inicio da linha)
        sub a0, a0, a3
        # B++
        addi t2, t2, 1
        # auxB = B
        blt t2, s9, f1loop2
        # }
        # A += N*4 (salta uma linha)
        add a0, a0, a3
        # B = B
        sub a1, zero, s2
        # for(...,...,i++)
        addi t1, t1, 1
        # for(...,i<size,...)
        blt t1, s9, f1loop1
        # }


        # Second part: D = alpha*T1 + beta*C #

        # Inicialização de auxiliares:
        addi t0, zero, 4 #
        mul a3, s9, t0   # a3 -> 4*N
        add a0, zero, s3 # a0 -> *C
        add a1, zero, s4 # a1 -> *D
        add a2, zero, s5 # a2 -> *T1

        # for(j=0,...,...){
        add t0, zero, zero 
f2loop1:
        # for(i=0,...,...){
        add t1, zero, zero
f2loop2:
        # ... = ... + ...*memory(C,R,i,j,0)
        lw t2, 0(a0)
        # ... = ...*memory(T1,R,i,j,0) + ...
        lw t3, 0(a2)
        # ... = alpha*memory(T1,R,i,j,0) + ...
        mul t4, s7, t3
        # ... = ... + beta*memory(C,R,i,j,0)
        mul t5, s8, t2
        # aux1 = alpha*memory(T1,R,i,j,0) + beta*memory(C,R,i,j,0)
        add t5, t5, t4
        # memory(D,W,i,j, aux1);
        sw t5, 0(a1)
        # C += N*4 (salta uma linha)
        add a0, a3, a0
        # D += N*4 (salta uma linha)
        add a1, a3, a1
        # T1 += N*4 (salta uma linha)
        add a2, a3, a2
		# for(...,...,j++)
        addi t0, t0, 1
		# for(...,j<size,...)
        blt t0, s9, f2loop1
        # }
        # C -= N*N*4 (rebobina para a primeira posição da matriz) 
        add a0, zero, s3
        # D -= N*N*4 (rebobina para a primeira posição da matriz) 
        add a1, zero, s4
        # T1 -= N*N*4 (rebobina para a primeira posição da matriz) 
        add a2, zero, s5
        # for(...,...,i++)
        addi t1, t1, 1
        # aux1 = j*4
        addi t1, zero, 4
        mul t1, t0, t1
        # C += aux1
        add a0, t1, a0
        # D += aux1
        add a1, t1, a1
        # T1 += aux1
        add a2, t1, a2  
       	# for(...,i<size,...)
        blt t1, s9, f2loop2
        # }


        # return
        li a7, 1
        ecall